import React, { Component } from 'react';
import './Feed.css';

class Feed extends Component {

  componentDidMount() {

  }

  render() {
    const { src, country, city } = this.props.data;

    return (
      <div className="feed">
        <h1>{country}, {city}</h1>
        <iframe title="feed" src={src + '?autoplay=1'}></iframe>
      </div>
    );
  }
}

export default Feed;
